import './Card.css';
import React, { Component } from 'react';
import { Button } from "@blueprintjs/core";


class Card extends Component {
    constructor(props) {
        super(props);
        this.state = {
            to_do: []
        };
    }

    componentDidMount = () => {
        console.log("mounted")
    }

    launchModal = () => {
        console.log("Clicked")
    }
    
    render() {
        return (
            <div className="Card">
                <div className="CardHeader">
                <div className="CardHeaderCell">
                    <h2>{this.props.list_name}</h2>
                </div>
                <div className="CardHeaderCell">
                    <Button intent="success" text="Add" /*onClick={launchModal}*/ className="CardBtn"/>
                </div>  
                    
                </div>
                <div className="CardBody">
                    {this.props.list_items.map((item) => {
                         return(<div>{item.name}</div>);
                    })}
                </div>
            </div>
          )
    }
  
}

export default Card;
